CREATE TABLE info (
	id int NOT NULL, 
	username varchar(255), 
	file varchar(255),
        status varchar(255),
	imagelinks varchar(255), 
	dateOfAnnotation varchar(255), 
	PRIMARY KEY (id)
);
CREATE TABLE puids (
	id int NOT NULL, 
	pfile varchar(255), 
	pfilepath varchar(255), 
	PRIMARY KEY (id)
);

